import React from "react";
import { Link } from "react-router-dom";
import './haeder.css';

function Header() {
    return(
        <div className="container">
            <Link to={'/home'}>home</Link>
            <Link to={'/library'}>library</Link>
            <Link to={'/network'}>network</Link>
            <Breadcrumbs />
        </div>
    );
    
}
export default Header;
